#
# TABLE STRUCTURE FOR: object_refs
#

DROP TABLE IF EXISTS `object_refs`;

CREATE TABLE `object_refs` (
  `obj_id` int(11) NOT NULL,
  `atel_num` int(11) NOT NULL,
  PRIMARY KEY (`obj_id`,`atel_num`),
  KEY `atel_num` (`atel_num`),
  CONSTRAINT `object_refs_ibfk_1` FOREIGN KEY (`obj_id`) REFERENCES `objects` (`obj_id`),
  CONSTRAINT `object_refs_ibfk_2` FOREIGN KEY (`atel_num`) REFERENCES `reports` (`atel_num`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



